import React from "react";
import ButtonChallenge1 from "./buttonchallenge1.js";
import TableChallenge1 from "./tablechallenge1.js";
import TableChallenge2 from "./tablechallenge2.js";

class MenuNav1 extends React.Component {
  constructor() {
    super();
    this.state = { cshow: "None Component Showing" };
  }

  myClickHandler = (event) => {
    let nam = event.target.name;
    let cshow = null;
    alert("Button Component Is: " + nam);
    switch (nam) {
      case "TableChallenge1":
        cshow = <TableChallenge1 />;
        break;
      case "TableChallenge2":
        cshow = <TableChallenge2 />;
        break;
      case "ButtonChallenge1":
        cshow = <ButtonChallenge1 />;
        break;
    }
    this.setState({ cshow: cshow });
  };

  render() {
    const cshow0 = "None Component Showing";
    const cshow11 = <ButtonChallenge1 />;
    const cshow1 = <TableChallenge1 />;
    const cshow2 = <TableChallenge2 />;

    return (
      <div>
        <h1>Hi, I am MenuNav1 component.</h1>
        <h4>Click any button to see its component.</h4>
        <div style={{ backgroundColor: "#e0e0e0" }}>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="TableChallenge1"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            TableChallenge1.js
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="TableChallenge2"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            TableChallenge2.js
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="ButtonChallenge1"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            ButtonChallenge1.js
          </button>
        </div>
        <div style={{ backgroundColor: "black" }}>
          <h3>Component Showing:</h3>
          <hr />
          {this.state.cshow}
        </div>
      </div>
    );
  }
}

export default MenuNav1;
